const Logout = () => {

  const handleLogout = () => {
    localStorage.removeItem('token-info');
  }
  return (
    <div>
      <p>Click below button to logout.</p>
      <button className="loginBtn" onClick={handleLogout}>Logout</button>
    </div>
  )
}

export default Logout
